description:
Illmatic is the debut album of American rapper Nas, released on April 19, 1994, by Columbia Records. After signing to the label with the help of MC Serch, Nas recorded the album during 1992 and 1993 at Chung King Studios, D&amp;D Recording, Battery Studios, and Unique Recording Studios in New York City. Its production was handled by Nas, Large Professor, Pete Rock, Q-Tip, L.E.S., and DJ Premier. Styled as a hardcore hip hop album, Illmatic features multi-syllabic internal rhyme patterns and inner city narratives based on Nas's experiences in Queensbridge, New York.

